INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPT', 'STOCK', 'Camden Property Trust', 'NYQ', 'Real Estate', 'REIT - Residential', 'Camden Property Trust é um fundo de investimento imobiliário (REIT). A Empresa e suas subsidiárias estão principalmente envolvidas na propriedade, gestão, desenvolvimento, reposicionamento, redesenvolvimento, aquisição e construção de condomínios multifamiliares. Possui e opera aproximadamente 175 propriedades contendo 59 210 casas de apartamentos em todo os Estados Unidos. Tem três propriedades em desenvolvimento e consistirá de um total de 60 348 casas de apartamentos. Suas propriedades geralmente consistem em edifícios de arranha-céus ou edifícios de dois e três andares em um ambiente paisagístico, bem como edifícios altos, e fornecem aos moradores uma variedade de comodidades comuns às propriedades de aluguel multifamiliares. As propriedades da empresa incluem Camden Chandler, Camden Copper Square, Camden Foothills, Camden Legacy e outros. Suas propriedades estão localizadas no Arizona, Califórnia, Colorado, Washington District of Columbia (DC) Metro, Flórida e outros.', 'Houston, TX, United States', 1660);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSWC', 'STOCK', 'Capital Southwest Corporation', 'NMS', 'Financial Services', 'Asset Management', 'Capital Southwest Corporation is an internally managed business development company. The Company is a market lending firm focused on supporting the acquisition and growth of middle market businesses with investments across the capital structure, including first lien, second lien and non-control equity co-investments. It specializes in providing customized debt and equity financing to lower middle market (LMM) companies in a broad range of investment segments located primarily in the United States. Its investment objective is to produce attractive risk-adjusted returns by generating current income from its debt investments and capital appreciation from its equity and equity-related investments. It invests primarily in first-lien debt securities, secured by security interests in portfolio company assets. It also invests in equity interests in its portfolio companies alongside its debt securities. It also offers managerial assistance to its portfolio companies.', 'Dallas, TX, United States', 30);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETNB', 'STOCK', '89bio, Inc.', 'NGM', 'Healthcare', 'Biotechnology', '89bio, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on the development and commercialization of therapies for the treatment of liver and cardio-metabolic diseases. The Companys lead product candidate, pegozafermin, a specifically engineered glycoPEGylated analog of fibroblast growth factor 21 (FGF21), is being developed for the treatment of metabolic dysfunction-associated steatohepatitis (MASH). Pegozafermin is engineered to protect against proteolysis and reduce renal clearance and optimize its potency, enabling the potential use of a lower dosage/dose. Pegozafermin has been optimally constructed with two mutations via substitutions with natural amino acids at site-specific positions (173 and 176) toward the C-terminus end of the hormone.', 'San Francisco, CA, United States', 93);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BASE', 'STOCK', 'Couchbase, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Couchbase, Inc. provides a cloud database platform for modern applications. The Company provides the developer data platform for critical applications in its artificial intelligence (AI) world. Its products include Couchbase Capella, Couchbase Server, Couchbase Mobile & Edge Computing, Couchbase Edge Server, and Intelligent Data Services. Its Couchbase Capella is a fully managed, automated, and secure DBaaS that simplifies deployment and operations across cloud environments. Its Couchbase Server is a multiservice NoSQL database that combines relational databases (ACID transactions, SQL++ for querying) with the scalability and flexibility of NoSQL. Its Couchbase Mobile is a full-featured embedded NoSQL database designed for mobile and IoT applications that require always-on availability. Its Couchbase Edge Server extends data processing to resource-constrained environments, providing low-latency access, offline resilience, and real-time synchronization.', 'Santa Clara, CA, United States', 804);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OTRK', 'STOCK', 'Ontrak, Inc.', 'NCM', 'Healthcare', 'Health Information Services', 'Ontrak, Inc. is a value-based behavioral healthcare company that identifies and engages people with unmet health needs using its advanced engagement system to improve clinical outcomes. The Company identifies, engages, and delivers care to the vulnerable members of the behavioral health population who would otherwise fall through the cracks of the healthcare system. Through its Advanced Engagement System, it engages individuals with anxiety, depression, substance use disorders and chronic disease by delivering personalized care coaching and customized care pathways that help them receive the treatment and advocacy they need, despite the socio-economic, medical and health system barriers that exacerbate the severity of their comorbid illnesses. It integrates AI, predictive analytics, comprehensive clinical and claims data, patient-generated information, and digital interfaces with care coach engagements to deliver improved member health and better healthcare system utilization.', 'Miami, FL, United States', 104);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RVLV', 'STOCK', 'Revolve Group, Inc.', 'NYQ', 'Consumer Cyclical', 'Internet Retail', 'Revolve Group, Inc. is a fashion retailer for millennial and generation Z consumers. The Company is an online retailer and fashion brand. Through its Websites and mobile applications, it delivers a customer experience with a curated merchandise offering. The Company sells merchandise through two segments: REVOLVE and FWRD. REVOLVE segment offers an assortment of premium apparel, footwear, beauty, accessories and home products from emerging, established and owned brands. FWRD segment offers an assortment of curated and elevated iconic and emerging luxury brands. Its platform connects a community of consumers, global fashion influencers, and emerging, established, and owned brands. The Company offers products under various brands, such as Lovers and Friends, GRLFRND, NBD, Camila Coelho, Alexandre Vauthier, and House of Harlow 1960. Its customers can engage with the Company in approximately 12 languages and pay in over 50 currencies.', 'Cerritos, CA, United States', 1632);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANGL', 'STOCK', 'VanEck Fallen Angel High Yield Bond ETF', 'NGM', NULL, NULL, 'The fund normally invests at least 80% of its total assets in securities that comprise the fund''s benchmark index. The index is comprised of below investment grade corporate bonds denominated in U.S. dollars that were rated investment grade at the time of issuance.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLLS', 'STOCK', 'Cellectis S.A.', 'NGM', 'Healthcare', 'Biotechnology', 'Cellectis SA is a France-based company active in the field of genome engineering and genomic surgery. The Company specializes in the research, development, and commercialization of rational genome engineering technologies. The Company develops immunotherapies that aim to force the immune system to target and eradicate cancer cells. It has developed an expertise in combining meganucleases with engineered targeting Deoxyribonucleic Acid (DNA) matrices into Meganuclease Recombination Systems (MRS), used for gene excision, correction or replacement. Cellectis SA markets its technologies mainly for use in the research field, in pharmaceutical drug discovery programs, in the agronomics, bioproduction, and biotherapeutics fields. Cellectis SA operates several subsidiaries. The Company operates in France and the United States, among others.', 'Paris, , France', 216);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKR', 'STOCK', 'Acadia Realty Trust', 'NYQ', 'Real Estate', 'REIT - Retail', 'Acadia Realty Trust is an equity real estate investment trust (REIT). The Company is focused on the ownership, acquisition, development, and management of retail properties located primarily in high-barrier-to-entry, supply-constrained, densely populated metropolitan areas in the United States. The Company operates through three segments: Core Portfolio, Investment Management, and Structured Financing. The Company''s Core Portfolio segment consists primarily of retail properties located primarily in high-barrier-to-entry, densely populated metropolitan areas with a long-term investment horizon. The Company''s Investment Management segment holds primarily retail real estate in which the Company co-invests with high-institutional investors. The Company''s Structured Financing segment consists of earnings and expenses related to notes and mortgages receivable. The Company has ownership interests in approximately 210 properties within its core portfolio and investment management.', 'Rye, NY, United States', 129);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARI', 'STOCK', 'Apollo Commercial Real Estate Finance, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Apollo Commercial Real Estate Finance, Inc. is a real estate investment trust. The Company primarily originates, acquires, invests in and manages performing commercial first mortgage loans, subordinate financings and other commercial real estate-related debt investments. Its principal business objective is to acquire its target assets in order to provide attractive risk- adjusted returns to its stockholders over the long term, primarily through dividends and secondarily through capital appreciation. Its investment strategy is to identify opportunities within its target assets through its manager and its affiliates as well as their platform, which integrates real estate experience with private equity and capital markets in transaction sourcing, underwriting, execution, asset operation, management and disposition. It targets assets that are secured by real estate throughout the United States and Europe. The Company is externally managed and advised by ACREFI Management, LLC.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DKS', 'STOCK', 'DICK''S Sporting Goods, Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'A Dick''S Sporting Goods, Inc. É uma Varejista de artigos esportivos omni-channel. A empresa possui e opera Golf Galaxy, Public Lands, e indo embora! lojas especializadas concept, e também oferecem seus produtos on-line e através de suas aplicações móveis. Também possui e opera o Dick''s House of Sport e Golf Galaxy Performance Center, bem como o GameChanger, uma plataforma móvel de esportes para jovens para streaming ao vivo, agendamento, comunicações e scorekeeping. Ele opera aproximadamente 723 locais de artigos esportivos DA DICK em todos os Estados Unidos. Ele carrega uma grande variedade de marcas nacionais, incluindo, mas não limitado a, adidas, Asics, Brooks, Callaway Golf, Carhartt, Columbia, Hoka, Jordan, New Balance, Nike, peloton, The North Face, Under Armour, Wilson, Yeti, e outros. Suas marcas verticais incluem marcas que possui em linhas duras e softlines e estão disponíveis em suas lojas e on-line, como Alpine Design, CALIA, DSG, ETHOS, Fitness Gear, MAXFLI, Nishiki, Wa', 'Coraopolis, PA, United States', 18600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPL', 'STOCK', 'Amplitude, Inc.', 'NCM', 'Technology', 'Software - Application', 'Amplitude, Inc. provides a digital analytics platform that helps companies unlock the power of their products. The Companys Digital Analytics Platform helps businesses understand how people are using their products so they can build digital experiences. Its platform comprises several primary offerings: Amplitude Analytics, Amplitude Session Replay, Amplitude Feature Experimentation, Amplitude Web Experimentation, Amplitude Activation and Amplitude Guides and Surveys. Amplitude Analytics is the cornerstone of the platform and provides real-time insights into user behavior. Amplitude Activation unifies data across multiple sources, creating a single, enriched dataset that fuels analytics and personalization. Amplitude Guides and Surveys helps companies to deploy in-product guides, tours, and surveys, using the power of behavioral insights to fuel great results. Amplitude Feature Experimentation enables product, data, and engineering teams to build world-class experiments.', 'San Francisco, CA, United States', 800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGX', 'STOCK', 'Argan, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'Argan, Inc. is a holding company. The Company is a construction firm that conducts operations through its subsidiaries, Gemma Power Systems, LLC and affiliates (GPS), Atlantic Projects Company Limited and affiliates (APC), The Roberts Company, Inc. (TRC), and Southern Maryland Cable, Inc. (SMC). Through GPS and APC, its power industry services, it offers a suite of engineering, procurement, construction, commissioning, maintenance, project development and technical consulting services to the power generation market, including the renewable energy sector. Through TRC, the industrial construction services provide field services and project management that support new plant construction and additions, maintenance turnarounds, shutdowns and emergency mobilizations for industrial plants. Through SMC, its telecommunications infrastructure services provide project management, construction, installation and maintenance services to commercial, local government and federal government customers.', 'Arlington, VA, United States', 1595);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMN', 'STOCK', 'Eastman Chemical Company', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Eastman Chemical Company é uma empresa global de materiais especiais que produz uma gama de produtos encontrados em itens que as pessoas usam todos os dias. Seus segmentos incluem Materiais Avançados (AM), Aditivos e Produtos Funcionais (AFP), Intermediários Químicos (CI) e Fibras. O segmento AM produz e comercializa polímeros, filmes e plásticos com propriedades diferenciadas de desempenho para usos finais de valor agregado no transporte; duráveis e eletrônicos; construção e construção; mercados finais médicos e farmacêuticos e consumíveis. O segmento AFP fabrica materiais para produtos em alimentos, rações e agricultura; transporte; tratamento de água e energia; cuidados pessoais e bem-estar; construção e construção; consumíveis, duráveis e mercados finais eletrônicos. O segmento CI vende intermediários para mercados finais, como produtos químicos industriais e processamento, construção e construção, saúde e bem-estar, alimentos e rações. Seu segmento de fibras fabrica e vende plasti', 'Kingsport, TN, United States', 14000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBSH', 'STOCK', 'Commerce Bancshares, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Commerce Bancshares, Inc. is a bank holding company offering a full line of banking services through its subsidiaries, including payment solutions, investment management and securities brokerage. The Companys subsidiary, Commerce Bank (the Bank), operates full-service banking facilities across the Midwest, including the St. Louis and Kansas City metropolitan areas, Springfield, Central Missouri, Central Illinois, Wichita, Tulsa, Oklahoma City, and Denver. It also maintains commercial offices in Dallas, Houston, Cincinnati, Nashville, Des Moines, Indianapolis, and Grand Rapids and wealth offices in Dallas, Houston, and Naples. Its segments include Commercial, Consumer, and Wealth. The Commercial segment provides a full array of corporate lending, merchant and commercial bank card products, payment solutions, leasing, and international services, as well as business and government deposit, investment, institutional brokerage, and cash management services.', 'Kansas City, MO, United States', 4658);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTM', 'STOCK', 'DT Midstream, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'DT Midstream, Inc. is an owner, operator, and developer of natural gas interstate and intrastate pipelines, storage and gathering systems, compression, treatment, and surface facilities. The Company transports clean natural gas for utilities, power plants, marketers, large industrial customers, and energy producers. Its segments include Pipeline and Gathering. The Pipeline segment owns and operates interstate and intrastate natural gas pipelines, storage systems, and natural gas gathering lateral pipelines. It also has interests in equity method investees that own and operate interstate natural gas pipelines. The segment is engaged in the transportation and storage of natural gas for intermediate and end user customers. The Gathering segment owns and operates gas gathering systems. The segment is engaged in collecting natural gas from points at or near customers wells for delivery to plants for treating, to gathering pipelines for further gathering, or to pipelines for transportation.', 'Detroit, MI, United States', 556);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNOB', 'STOCK', 'ConnectOne Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'ConnectOne Bancorp, Inc. is a financial services company that operates, through its subsidiary, ConnectOne Bank (the Bank) and the Banks fintech subsidiary, BoeFly, Inc (BoeFly). ConnectOne Bank is a commercial bank offering a full suite of banking and lending products and services that focus on small to middle-market businesses. The Bank''s offices are located primarily in the New York metro market and span New Jersey, New York City, Long Island, and the Hudson Valley, including Rockland, Orange, and Westchester counties. It offers a range of deposit and loan products. It also provides a range of other banking services. Its products and services include personal and business checking accounts, money market accounts, time and savings accounts, credit cards, safe deposit boxes, access to automated teller services and telephone, and others. BoeFly is a fintech marketplace that connects borrowers in the franchise space with funding solutions through a network of partner banks.', 'Englewood Cliffs, NJ, United States', 489);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMLX', 'STOCK', 'Amylyx Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Amylyx Pharmaceuticals, Inc. is a clinical-stage pharmaceutical company. The Company is focused on three investigational therapies across several neurodegenerative and endocrine diseases. Its lead investigational asset is avexitide, an investigational, first-in-class glucagon-like peptide-1 (GLP-1) receptor antagonist. Avexitide has been evaluated as a treatment for Post-Bariatric Hypoglycemia (PBH) and congenital HI, two indications characterized by hyperinsulinemic hypoglycemia. In addition to avexitide, it is advancing AMX0035, an oral, fixed-dose combination of sodium phenylbutyrate and taurursodiol in Wolfram syndrome and progressive supranuclear palsy (PSP), and AMX0114 in amyotrophic lateral sclerosis (ALS). AMX0035 is designed to mitigate neurodegeneration by targeting endoplasmic reticulum stress and mitochondrial dysfunction, two cellular processes central to neuronal cell death and neurodegeneration. AMX0114 is an investigational antisense oligonucleotide.', 'Cambridge, MA, United States', 123);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADC', 'STOCK', 'Agree Realty Corporation', 'NYQ', 'Real Estate', 'REIT - Retail', 'A ACORD Realty Corporation é uma confiança integrada de investimento imobiliário (REIT) focada principalmente na propriedade, aquisição, desenvolvimento e gestão de propriedades de varejo líquidas alugadas a inquilinos. Os ativos da Companhia são detidos e todas as suas operações são realizadas através, direta ou indiretamente, da parceria operacional, da qual a Companhia é o único sócio geral. Seu portfólio é composto por mais de 2 370 propriedades localizadas em 50 estados e totalizando aproximadamente 48,8 milhões de pés quadrados de área bruta locável (ABL). Seu portfólio de propriedades está localizado em Texas, Ohio, Flórida, Michigan, Illinois, EUA. Carolina do Norte, Nova Jersey, Pensilvânia, Califórnia, Nova Iorque, Geórgia, Virgínia, Connecticut, Wisconsin e outros. Seus inquilinos incluem Walmart, Dollar General, Tractor Supply, Best Buy, Dollar Tree, TJX Companies, O''Reilly Auto Parts, CVS, Kroger, Lowe''s, Hobby Lobby, Burlington, Sherwin-Williams, Sunbelt Rentals, Wawa, ', 'Royal Oak, MI, United States', 75);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSCQ', 'STOCK', 'Invesco BulletShares 2026 Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment grade corporate bonds with maturities or, in some cases, "effective maturities" in the year 2026 (collectively, "2026 Bonds").', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALNY', 'STOCK', 'Alnylam Pharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'A Alnylam Pharmaceuticals, Inc. É uma empresa biofarmacêutica de estágio comercial. A empresa está envolvida na descoberta, desenvolvimento, fabricação e comercialização de novas terapias baseadas na interferência do ácido ribonucleico (RNAi). Seus produtos comercializados incluem AMVUTTRA (vutrisiran) para o tratamento da amiloidose mediada por transtiretina hereditária (hATTR) com polineuropatia em adultos; ONPATTRO (patisiran) para o tratamento da polineuropatia da amiloidose 1 Os programas de desenvolvimento clínico da empresa incluem Cemdisiran, Fitusiran, Zilebesiran, Elebsiran, Mivelsiran e ALN-HTT02. Está desenvolvendo o Cemdisiran para tratar doenças mediadas por complemento.', 'Cambridge, MA, United States', 2230);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CANF', 'STOCK', 'Can-Fite BioPharma Ltd.', 'ASE', 'Healthcare', 'Biotechnology', 'Can-Fite BioPharma Ltd., a clinical-stage biopharmaceutical company, develops orally bioavailable small molecule therapeutic products for the treatment of cancer, liver inflammatory diseases, and erectile dysfunction in Israel. The company''s lead drug candidate Piclidenoson, which has been completed Phase III clinical trial for the treatment of psoriasis. It develops Namodenoson that is in Phase III clinical trial for the treatment of liver cancer; and Phase IIa for the treatment of pancreatic cancer; as well as in Phase IIb trial for the treatment of metabolic associated steatohepatitis; and CF602, which is in pre-clinical trial for the treatment of erectile dysfunction. In addition, the company develops commercial predictive biomarker blood test kit for A3AR. It has license and collaboration agreement with CMS Medical to develop, manufacture, and commercialize Piclidenoson and Namodenoson; and collaboration agreement with Univo Pharmaceuticals to identify and co-develop specific for', 'Ramat Gan, , Israel', 5);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAK', 'STOCK', 'Braskem S.A.', 'NYQ', 'Basic Materials', 'Chemicals', 'A Braskem SA é uma petroquímica integrada no Brasil para a primeira e segunda geração de resinas termoplásticas. As atividades da Companhia são divididas em três segmentos operacionais: Brasil; Estados Unidos e Europa; e México. O segmento Brasil está focado na produção de resinas de polietileno (PE), polipropileno (PP) e policloreto de vinilo (PVC), além de insumos químicos básicos como etileno, propileno, butadieno, benzeno, tolueno, etc. cloro, soda e solventes, entre outros. O segmento Estados Unidos e Europa é responsável pela produção de polipropileno em unidades nos Estados Unidos e na Alemanha. O segmento México consiste na operação de blocos de etileno e de polietileno localizados no México.', 'São Paulo, SP, Brazil', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTKB', 'STOCK', 'Cytek Biosciences, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'Cytek Biosciences, Inc. is a cell analysis solutions company. The Company is advancing the cell analysis tools by delivering high-resolution, high-content, and high-sensitivity cell analysis utilizing its patented Full Spectrum Profiling (FSP) technology. Its platform includes its core FSP instruments, the Cytek Aurora and Northern Lights systems and the Cytek Aurora CS cell sorter; the Cytek Orion reagent cocktail preparation system; the Enhanced Small Particle (ESP) detection technology; the flow cytometer and imaging products under the Amnis and Guava brands, and reagents, software and service to provide a comprehensive and integrated suite of solutions for its customers. Its Cytek Aurora and Northern Lights systems are used in the study of infectious diseases, immunology, immunotherapy, immuno-oncology, oncology, and drug discovery. The Cytek Orion reagent cocktail preparation system enables researchers to fully automate the preparation of antibody cocktails for flow cytometry.', 'Fremont, CA, United States', 688);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIAF', 'STOCK', 'bioAffinity Technologies, Inc.', 'NCM', 'Healthcare', 'Diagnostics & Research', 'bioAffinity Technologies, Inc. is a biotechnology company focused on the need for noninvasive diagnosis of early-stage cancer and diseases of the lung and broad-spectrum cancer treatments. It develops noninvasive diagnostics to detect early-stage lung cancer and other diseases of the lung using flow cytometry and automated analysis developed by machine learning, a form of artificial intelligence (AI). The Companys product, CyPath Lung, is a noninvasive test that has shown high sensitivity, specificity and accuracy for the detection of early-stage lung cancer. CyPath is marketed as a Laboratory Developed Test (LDT) by Precision Pathology Laboratory Services, a subsidiary of the Company. CyPath Lung uses flow cytometry technology to detect and analyze cell populations in a persons sputum, or phlegm, to find characteristics indicative of lung cancer, including cancer and/or cancer-related cells that have shed from a lung tumor.', 'San Antonio, TX, United States', 57);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACRS', 'STOCK', 'Aclaris Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Aclaris Therapeutics, Inc. is a clinical-stage biopharmaceutical company. The Company is engaged in developing a pipeline of drug candidates to address the needs of patients with immuno-inflammatory diseases. It has a multi-stage portfolio of drug candidates powered by a robust research and development engine. Its KINect drug discovery platform, combined with its preclinical development capabilities, allows it to identify and advance potential product candidates that it may develop independently or in collaboration with third parties. It has two segments: therapeutics and contract research. The therapeutics segment is focused on identifying and developing therapies to address unmet needs for immuno-inflammatory diseases. The contract research segment is engaged in the provision of laboratory services. Its drug candidates include Bosakitug (ATI-045), ATI-2138 and ATI-052. Its other investigational product candidates include Lepzacitinib (ATI-1777) and Zunsemetinib (ATI-450).', 'Wayne, PA, United States', 61);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEEM', 'STOCK', 'Beam Global', 'NCM', 'Technology', 'Solar', 'Beam Global is a clean technology innovator which develops and manufactures sustainable infrastructure products and technologies. The Company develops designs, engineers, manufactures, and sells renewably energized infrastructure products for electric vehicle (EV) charging. It also manufactures steel structures with electronic integration such as street lighting, cell towers and energy infrastructure products, as well as power electronics including invertors, charge controllers, power supplies and light-emitting diode (LED) lighting. Its product offerings include EV ARC Electric Vehicle Autonomous Renewable Charger, Solar Tree Direct Current Fast Charge (DCFC), EV ARC DCFC, BeamSpot, BeamBike, BeamPatrol, BeamWell, and UAV ARC. Its EV ARC Electric Vehicle Autonomous Renewable Charger is a patented infrastructure product that uses integrated solar power and battery storage to provide a mounting asset and a source of power for factory installed electric vehicle charging stations.', 'San Diego, CA, United States', 245);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANNX', 'STOCK', 'Annexon, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Annexon, Inc. is a clinical-stage biopharmaceutical company advancing a late-stage clinical platform of novel therapies for people living with devastating classical complement-mediated neuroinflammatory diseases of the body, brain, and eye. It identifies and characterizes the role of the classical complement pathway in three therapeutic areas: autoimmune, neurodegeneration and ophthalmology, using its proprietary platform. Its lead candidate, ANX005, an investigational, full-length monoclonal antibody (mAb), is formulated for intravenous administration as the potential first targeted treatment for patients with Guillain-Barre Syndrome (GBS). It is advancing ANX1502, a novel small-molecule inhibitor of classical complement designed for oral administration in a range of chronic autoimmune diseases. It is also advancing ANX007, designed to block C1q locally in the eye, to provide complete protection against excess classical complement activity and the loss of photoreceptor neurons.', 'Brisbane, CA, United States', 106);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRC', 'STOCK', 'California Resources Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'California Resources Corporation is an independent energy and carbon management company committed to energy transition. The Companys segments include Oil and Natural Gas and Carbon Management. Its Carbon Management business, Carbon TerraVault, focuses on building, installing, operating, and maintaining carbon dioxide (CO2) equipment, transportation assets and storage facilities. The Oil and Natural Gas segment explores for, develops and produces crude oil, oil condensate, natural gas liquids and natural gas. It has operations in oil and gas basins, including San Joaquin Basin, Los Angeles Basin, Sacramento Basin, and other. It has interests in oil and gas fields throughout the San Joaquin basin, including in Elk Hills, Buena Vista, Coles Levee, North Belridge and South Belridge, Kern Front, Lost Hills, Cymric, McKittrick, Midway Sunset and Coalinga. The Los Angeles Basin is a northwest-trending plain about 50 miles long and 20 miles wide.', 'Long Beach, CA, United States', 1550);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHC', 'STOCK', 'Encompass Health Corporation', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Encompass Health Corporation is an owner and operator of inpatient rehabilitation hospitals in the United States. The Company provides compassionate rehabilitative care for patients recovering from a major injury or illness, using advanced technology and treatments to maximize recovery. It operates hospitals in 38 states and Puerto Rico, with concentrations in Florida and Texas. It operates approximately 166 inpatient rehabilitation hospitals. Its inpatient rehabilitation hospitals offer specialized rehabilitative care across an array of diagnoses and deliver comprehensive patient care services. It provides care to patients who suffer from cognitive disabilities or injuries due to medical conditions, such as strokes, hip fractures and a variety of debilitating neurological conditions. Its hospitals have settings for treating the debilitating effects of the COVID-19 virus, such as significant muscle weakness, cognitive impairments, shortness of breath with activity and malnutrition.', 'Birmingham, AL, United States', 28678);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACET', 'STOCK', 'Adicet Bio, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Adicet Bio, Inc. is a clinical-stage biotechnology company. It is engaged in advancing a pipeline of off-the-shelf gamma delta T cells, engineered with chimeric antigen receptors (CARs), to facilitate durable activity in patients. Its lead product candidate, ADI-001, a first-in-class allogeneic gamma delta T cell therapy expressing a CAR targeting CD20, is being developed for the potential treatment of autoimmune diseases. ADI-001 contains an anti-CD20 CAR that has a proprietary antigen-binding domain that recognizes a region of CD20 distinct from that recognized by rituximab. Its pipeline also includes ADI-270, an investigational allogeneic gamma delta CAR T cell therapy targeting CD70 via the CD27-ligand for the treatment of RCC and with potential in other solid tumor and hematological malignancy indications. Its pipeline has additional internal gamma delta T cell therapy programs in discovery and preclinical development for both hematological malignancies and solid tumors.', 'Boston, MA, United States', 152);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CISO', 'STOCK', 'CISO Global Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'CISO Global, Inc. is a cybersecurity, compliance, and software company. The Company provides a full range of cybersecurity consulting and related services, encompassing compliance, cybersecurity, and culture. It offers three types of services to clients, including security managed services, professional services, and cybersecurity software. The Companys services include managed security, compliance services, security operations center (SOC) services, virtual Chief Information Security Officer (vCISO) services, incident response, certified forensics, technical assessments, and cybersecurity training. Its cybersecurity software offers a comprehensive suite of proactive cybersecurity software solutions designed to protect organizations from evolving cyber threats. Its CISO Edge is an artificial intelligence (AI) -driven cloud security solution that provides comprehensive protection across cloud-first, hybrid, and remote environments.', 'Scottsdale, AZ, United States', 141);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMPY', 'STOCK', 'Amplify Energy Corp.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Amplify Energy Corp. is an independent oil and natural gas company engaged in the acquisition, development, exploitation and production of oil and natural gas properties. The Companys operations are focused on Oklahoma, the Rockies (Bairoil), federal waters offshore Southern California (Beta), and East Texas / North Louisiana. Its liquid-rich acreage in Oklahoma consisted of approximately 95 thousand net (112 thousand gross) prospective acres in the Mississippian Lime trend in the Woods and Alfalfa Counties of Oklahoma. Its liquids-heavy Rockies properties include wells and properties primarily located in the Lost Soldier and Wertz fields in the Rockies at its Bairoil complex. Its Beta properties include two wellbore production platforms and one production handling and processing platform. The Companys business activities are conducted through Amplify Energy Operating LLC, its wholly owned subsidiary, and its wholly owned subsidiaries.', 'Houston, TX, United States', 229);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENR', 'STOCK', 'Energizer Holdings, Inc.', 'NYQ', 'Industrials', 'Electrical Equipment & Parts', 'Energizer Holdings, Inc. is a manufacturer and distributor of primary batteries, portable lights, and auto care appearance, performance, refrigerant, and fragrance products. The Company''s segments include Batteries & Lights, and Auto Care. The Company offers household batteries including primary, rechargeable, specialty and hearing aid using many technologies including lithium, alkaline, carbon zinc, nickel metal hydride, zinc air, and silver oxide. It offers auto care products in the appearance, fragrance, performance, and air conditioning recharge product categories. Its portfolio of brands includes Energizer, Armor All, Eveready, Rayovac, STP, Varta, A/C Pro, Refresh Your Car!, California Scents, Driven, Bahama & Co., LEXOL, Eagle One, Nu Finish, Scratch Doctor, and Tuff Stuff. It distributes its products to consumers through numerous retail locations worldwide, including mass merchandisers and warehouse clubs, food, drug and convenience stores, e-commerce and military stores.', 'Saint Louis, MO, United States', 5600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRL', 'STOCK', 'Charles River Laboratories International, Inc.', 'NYQ', 'Healthcare', 'Diagnostics & Research', 'Charles River Laboratories International, Inc. is a drug development company. It provides essential products and services to help pharmaceutical and biotechnology companies, government agencies and academic institutions around the globe accelerate their research and drug development efforts. Its Research Models and Services segment includes three businesses that provide foundational tools that enable its clients to discover new molecules: Research Models, Research Model Services, and Cell Solutions. Its Discovery and Safety Assessment segment provides regulated and non-regulated DSA services to support the research, development, and regulatory-required safety testing of potential new drugs, including therapeutic discovery and optimization plus in vitro and in vivo studies, laboratory support services, and strategic non-clinical consulting and program management to support product development. Its Manufacturing Solutions segment includes Microbial Solutions and Biologics Solutions.', 'Wilmington, MA, United States', 18700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOTZ', 'STOCK', 'Global X Robotics & Artificial Intelligence ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index. The underlying index is designed to provide exposure to exchange-listed companies in developed markets that are involved in the development of robotics and/or artificial intelligence as defined by Indxx, the provider of the underlying index. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOX', 'STOCK', 'Amdocs Limited', 'NMS', 'Technology', 'Software - Infrastructure', 'A Amdocs Limited é uma fornecedora de software e serviços para empresas de comunicação e mídia em países desenvolvidos e mercados emergentes. As ofertas da empresa são baseadas em uma mistura de produtos e serviços, usando tecnologias e metodologias, como nuvem e nuvem nativa, microsserviços, desenvolvimento e operações (DevOps), baixo código/sem código, computação de borda, código aberto, operações bimodais, engenharia de Confiabilidade do Local (SRE) e quantidades crescentes de automação através de ferramentas de tecnologia da informação (TI) padrão, interface de programação de aplicações abertas (APIs) e inteligência artificial (IA), inteligência artificial generativa (GenAI) e aprendizado de máquina (ML). Sua linha abrangente de serviços é projetada para atender a todas as etapas do ciclo de vida de um provedor de serviços e inclui consultoria, entrega, engenharia de qualidade (testes), integração de sistemas, operações e serviços. serviços de rede, serviços orientados por experiên', 'Saint Louis, MO, United States', 29058);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYN', 'STOCK', 'Cyngn Inc.', 'NCM', 'Technology', 'Software - Application', 'Cyngn Inc. is an autonomous vehicle (AV) technology company that is focused on addressing industrial uses for autonomous vehicles. The Company integrates its full-stack autonomous driving software, DriveMod, into vehicles manufactured by an original equipment manufacturer either via retrofit of existing vehicles or by integration directly into vehicle assembly. It designs the Enterprise Autonomy Suite (EAS) to be compatible with sensors and components from hardware technology providers and integrates its proprietary Autonomous Vehicle (AV) software to produce differentiated autonomous vehicles. EAS is a suite of technologies and tools that is divided into three categories: DriveMod, Cyngn Insight, and Cyngn Evolve. DriveMod is a modular industrial vehicle autonomous driving software. Cyngn Insight is a customer-facing tool suite for monitoring and managing AV fleets and generating/aggregating/analyzing data. Cyngn Evolve is an internal tool suite.', 'Menlo Park, CA, United States', 58);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBAR', 'STOCK', 'Banco BBVA Argentina S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banco Bbva Argentina SA, formerly known as BBVA French Bank, is an Argentina-based banking institution. Through its banking platform, the Bank provides a broad range of financial and non-financial services to both individuals and companies. It manages three business lines: Retail Banking, Small and Medium-Sized Companies and Corporate and Investment Banking (C&IB). Retail Banking offers checking and savings accounts, time deposits, credit cards, loans, mortgages, insurance and investment products, among others. Small and Medium-Sized Companies targets local private-sector companies providing financing products, factoring, checking accounts, time deposits, transactional and payroll services, insurance and investment products, among others. C&IB offers financial services to corporations and multinational companies, as well as global transaction services, global markets solutions, long term financing, among others. The Bank is active locally, mostly.', 'Buenos Aires, , Argentina', 6399);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRCC', 'STOCK', 'BRC Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'BRC Inc. is a Veteran-founded and led coffee, energy drink, and media company. The Company purchases, roasts, and sells coffee, coffee accessories, and branded apparel through its online channels and business networks. Its product offerings include roast coffee, single-serve coffee, ready-to-drink (RTD) coffee, and Black Rifle Energy (RTD energy beverage). It offers Black Rifle branded apparel, coffee brewing equipment, and outdoor and lifestyle gear. The Company operates through three primary channels: Wholesale, Direct-to-Consumer (DTC), and Outposts. In its Wholesale channel, it sells packaged coffee and its RTD beverages through Food, Drug, and Mass (FDM) retailers such as Walmart, Sams Club, regional and national grocery chains, and convenience stores, such as 7-Eleven, Caseys General Store, and Circle K. Its Outposts channel offers brewed coffee and Black Rifle Coffee merchandise. The Company also develops and promotes online content for the purpose of growing its brands.', 'Salt Lake City, UT, United States', 551);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHT', 'STOCK', 'DHT Holdings, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'DHT Holdings, Inc. is an independent crude oil tanker company. The Company''s fleet trades internationally and consists of crude oil tankers in the Very Large Crude Carriers (VLCC) segment. Its primary business is operating a fleet of crude oil tankers, with a secondary activity of providing technical management services. The Company operates its vessels through its subsidiary management companies in Monaco, Norway, Singapore, and India. Its principal activity is the ownership and operation of a fleet of crude oil carriers. It has approximately 28 vessels in operation. The fleet operates globally on international routes. The Company''s fleets are comprised of DHT Addax, DHT Antelope, DHT Gazelle, DHT Impala, DHT Appaloosa, DHT Mustang, DHT Bronco, DHT Colt, DHT Stallion, DHT Tiger, DHT Harrier, DHT Puma, DHT Panther, DHT Osprey, DHT Lion, DHT Leopard, DHT Jaguar, DHT Taiga, DHT Sundarbans, and DHT Scandinavia, among others.', 'Hamilton, , Bermuda', 924);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVAX', 'STOCK', 'Dynavax Technologies Corporation', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Dynavax Technologies Corporation is a commercial-stage biopharmaceutical company developing and commercializing vaccines to help protect against infectious diseases. The Company has two commercial products: HEPLISAV-B vaccine (Hepatitis B Vaccine (Recombinant), Adjuvanted), and CpG 1018 adjuvant. The HEPLISAV-B vaccine is used for the prevention of infection caused by all known subtypes of hepatitis B virus in adults 18 years of age and older. HEPLISAV-B is a two-dose in-one-month adult hepatitis B vaccine. CpG 1018 adjuvant is used in HEPLISAV-B and multiple adjuvanted COVID-19 vaccines. The Company is advancing a pipeline of differentiated product candidates that leverage its CpG 1018 adjuvant to develop improved vaccines in indications with unmet medical needs. Its pipeline programs include Shingles vaccine program (Z-1018) and Plague vaccine program. Z-1018 is an investigational vaccine candidate being developed for the prevention of shingles in adults aged 50 and older.', 'EmeryVille, CA, United States', 405);\n
